import './NavBar.css';
import { NavLink } from 'react-router-dom';

function NavBar() {
  return (
	<>
		<Nav>
			<NavLink to="/">
				<div className="logo">Haytham</div>
				<div className="logo-sub">Dev</div>
			</NavLink>
		</Nav>
	</>
  )
}

